import ExpenseItem from "./components/ExpenseItem";

function App() {
  //making a database using arrays
  const expenses = [
    {
      id: "e1",
      title: "AC filter",
      amount: 95.13,
      //inbuilt method for date in js
      date: new Date(2022, 11, 5),
    },
    {
      id: "e2",
      title: "Suspension repair",
      amount: 210.13,
      date: new Date(2022, 10, 23),
    },
    {
      id: "e3",
      title: "Seat Covers",
      amount: 100.13,
      date: new Date(2021, 5, 5),
    },
    {
      id: "e1",
      title: "Lights replace",
      amount: 54.13,
      date: new Date(2020, 3, 4),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        name={expenses[0].title}
        charge={expenses[0].amount}
        date={expenses[0].date}
      ></ExpenseItem>
      <ExpenseItem
        name={expenses[1].title}
        charge={expenses[1].amount}
        date={expenses[1].date}
      ></ExpenseItem>
      <ExpenseItem
        name={expenses[2].title}
        charge={expenses[2].amount}
        date={expenses[2].date}
      ></ExpenseItem>
      <ExpenseItem
        name={expenses[3].title}
        charge={expenses[3].amount}
        date={expenses[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
